import React, { useEffect } from 'react'

function Results() {
  const[results, setResults]=useState([])
  useEffect(()=>{
    fetch('http://localhost:3000/results')
    .then(res=>res.json())
    .then(data=>{
      console.log(data)
    })
  })
  return (
    <div></div>
  )
}

export default Results
